import React from "react";
import explicit from "./explicit.png";
import "./Dashboard.css";
export default function TrackSearchResult({ track, chooseTrack }) {
  function handlePlay() {
    chooseTrack(track);
  }
  function MouseOver(event) {
    event.target.style.background = "red";
  }
  function MouseOut(event) {
    event.target.style.background = "";
  }
  //console.log(artist);
  return (
    <div onMouseOver={MouseOver} onMouseOut={MouseOut}>
      <div
        className="d-flex m-2 align-items-center hover-zoom "
        id="tracks"
        style={{ cursor: "pointer" }}
        onClick={handlePlay}
      >
        <img src={track.art} style={{ height: "64px", width: "64px" }} />
        <div className="m-2">
          <div>
            {track.name}{" "}
            {track.explicit ? (
              <img
                src={explicit}
                style={{ height: "16px", width: "16px" }}
              ></img>
            ) : (
              " "
            )}
          </div>
          <div className="text-muted">{track.albumName}</div>
          <div className="text-muted">{"Released: " + track.release}</div>
          {/* <div className="text-muted">{track.artist}</div> */}
        </div>
      </div>
    </div>
  );
}
